import styled from 'styled-components';

export const HeaderWrapper = styled.header`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 100vw;
`;

export const LumaLogo = styled.image`
  display: flex;
  align-items: center;
  gap: 10px;
`;

export const LumaRectangle = styled.img``;

export const LumaFlame = styled.img`
  width: 4rem;
`;

export const ProductName = styled.div`
  text-align: end;
  font-family: 'IBMPlexSans-Regular', Helvetica;
  font-size: 10px;
  font-weight: 600;
`;
export const ProductSubName = styled.div`
  text-align: end;
  font-family: 'IBMPlexSans-Regular', Helvetica;
  font-size: 10px;
`;

export const CarrierLogo = styled.img`
  float: right;
  width: 3.5rem;
`;
